import Head from 'next/head';

import Menu from '../components/Menu';

import { Jumbotron, Container } from 'reactstrap';

import 'bootstrap/dist/css/bootstrap.min.css';

import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';
library.add(fas);

function Home() {
    return (
        <div>
            <Head>
                <title>Patinha Solid√°ria</title>
                <meta name='description' content='Site de ... sobre ...' />
                <meta name='author' content='Celke' />
            </Head>
            <Menu />
            <Jumbotron fluid className="servicos">
                <style>{`.servicos{
                    padding-top: 80px;
                    padding-bottom: 80px;
                    background-color: #000;
                    color: #fff;
                    margin-bottom: 0rem !important;
                }
                .circulo{
                    width:140px;
                    height: 140px;
                    background-color: #fed136;
                    font-size: 52px;
                    padding-top: 24px;
                }
                .centralizar{
                    margin: 0 auto !important;
                    float: none !important;
                }`}</style>
                <Container className='text-center'>
                    <div>
                        <h1 className='display-4'>Patinha Soli</h1>
                        <p className='lead pb-4'>Temos a solu√ß√£o que o seu animal precisa!</p>
                    </div>
                    <div class="row">
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar">
                                <FontAwesomeIcon icon='dolly' />
                            </div>
                            <h2 className='mt-4 mb-4'>Servi√ßos 1</h2>
                            <p>Donec sed odio dui. Etiam porta sem malesuada magna mollis euismod. Nullam id dolor id nibh ultricies vehicula ut id elit. Morbi leo risus, porta ac consectetur ac, vestibulum at eros. Praesent commodo cursus magna.</p>
                        </div>
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar">
                                <FontAwesomeIcon icon="project-diagram" />
                            </div>
                            <h2 className='mt-4 mb-4'>Servi√ßos 2</h2>
                            <p>Duis mollis, est non commodo luctus, nisi erat porttitor ligula, eget lacinia odio sem nec elit. Cras mattis consectetur purus sit amet fermentum. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh.</p>
                        </div>
                        <div class="col-lg-4">
                            <div className="rounded-circle circulo centralizar">
                                <FontAwesomeIcon icon="dolly-flatbed" />
                            </div>
                            <h2 className='mt-4 mb-4'>Servi√ßos 3</h2>
                            <p>Donec sed odio dui. Cras justo odio, dapibus ac facilisis in, egestas eget quam. Vestibulum id ligula porta felis euismod semper. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus.</p>
                        </div>
    </div>
                </Container>
            </Jumbotron>
        </div>
    );
}

export default Home;
